"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[2707],{2707:e=>{e.exports=JSON.parse('{"lessonId":"A2_U24","title":"\u0423\u0440\u043e\u043a 24: m\xe1s, menos, tanto (\u0421\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0435 \u0441 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438)","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f","content":[{"text":"<strong>M\xe1s, menos, tanto</strong> \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u0434\u043b\u044f \u0441\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u044f \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0441 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438."},{"list":["<strong>m\xe1s</strong> = mayor cantidad (+) (\u0431\u043e\u043b\u044c\u0448\u0435\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e)","<strong>menos</strong> = menor cantidad (-) (\u043c\u0435\u043d\u044c\u0448\u0435\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e)","<strong>tanto</strong> = igual cantidad (=) (\u0440\u0430\u0432\u043d\u043e\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e)"]}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0421\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0435 \u0441 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438","content":[{"table":{"headers":["\u0421\u0442\u0435\u043f\u0435\u043d\u044c","\u0424\u043e\u0440\u043c\u0443\u043b\u0430","\u041f\u0440\u0438\u043c\u0435\u0440\u044b"],"rows":[["<strong>\u041f\u0440\u0435\u0432\u043e\u0441\u0445\u043e\u0434\u0441\u0442\u0432\u043e (+)</strong>","<strong>m\xe1s + nombre (+ que)</strong>","Ernesto tiene <strong>m\xe1s alumnos que</strong> Guadalupe.<br>Pedro tiene <strong>m\xe1s amigos que</strong> Antonio."],["<strong>\u041c\u0435\u043d\u044c\u0448\u0430\u044f \u0441\u0442\u0435\u043f\u0435\u043d\u044c (-)</strong>","<strong>menos + nombre (+ que)</strong>","Antes hab\xeda <strong>menos coches que</strong> ahora.<br>Ahora tengo <strong>menos sue\xf1o</strong> (que antes)."],["<strong>\u0420\u0430\u0432\u0435\u043d\u0441\u0442\u0432\u043e (=)</strong>","<strong>tanto, tanta, tantos, tantas + nombre (+ como)</strong>","Hoy no hay <strong>tanta gente como</strong> ayer.<br>No tengo <strong>tantos amigos como</strong> mi hermana."]]}},{"text":"<strong>`que, como` + \u043b\u0438\u0447\u043d\u043e\u0435 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u0435</strong><br><i>Rodolfo tiene m\xe1s vacaciones <strong>que t\xfa</strong>, pero t\xfa haces m\xe1s viajes <strong>que \xe9l</strong>.</i>"},{"text":"<strong>\u041e\u0431\u044b\u0447\u043d\u043e `no` \u0441\u0442\u0430\u0432\u0438\u0442\u0441\u044f \u043f\u0435\u0440\u0435\u0434 \u0433\u043b\u0430\u0433\u043e\u043b\u043e\u043c, \u0430 \u043d\u0435 \u043f\u0435\u0440\u0435\u0434 `tanto`</strong>, \u043a\u043e\u0433\u0434\u0430 \u0441\u0440\u0430\u0432\u043d\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441 \u0447\u0435\u043c-\u0442\u043e, \u0447\u0442\u043e \u0431\u044b\u043b\u043e \u0440\u0430\u043d\u044c\u0448\u0435.<br><i>Ahora tengo menos hambre. (que antes de la comida)<br>Hoy no hay tanta gente. (como ayer)</i>"},{"text":"<strong>`M\xe1s, menos, tanto...` \u043c\u043e\u0433\u0443\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e</strong>, \u043a\u043e\u0433\u0434\u0430 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435, \u043a \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u043e\u043d\u0438 \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f, \u0443\u0436\u0435 \u0431\u044b\u043b\u043e \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442\u043e.<br><i>\u2013Sonia tiene cerca de cien CD. \u2013Yo tengo <strong>m\xe1s</strong>.<br>\u2013Pues yo no tengo <strong>tantos</strong>.</i>"},{"text":"<strong>\u041d\u041e:</strong> \u0432 \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0444\u0440\u0430\u0437\u0430\u0445 `tanto, tanta, tantos, tantas` \u0432\u0441\u0435\u0433\u0434\u0430 \u0438\u0434\u0443\u0442 \u0441 `como` + \u0442\u0435\u0440\u043c\u0438\u043d \u0441\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u044f.<br><i>\u2013Elisa tiene una gran colecci\xf3n de CD. \u2013Yo tengo <strong>tantos</strong>. (\u043d\u0435\u0432\u0435\u0440\u043d\u043e) \u2192 Yo tengo <strong>tantos como</strong> ella.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 24.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 m\xe1s, menos \u0438\u043b\u0438 tanto, tanta, tantos, tantas","tasks":[{"id":"u24_1_1","sentence":"1. Buenos Aires tiene (+) ___ habitantes que Madrid.","answer":"m\xe1s"},{"id":"u24_1_2","sentence":"2. Ahora bebo (\u2013) ___ leche que cuando era peque\xf1o.","answer":"menos"},{"id":"u24_1_3","sentence":"3. Sol ha le\xeddo (\u2013) ___ libros que yo.","answer":"menos"},{"id":"u24_1_4","sentence":"4. No tengo (=) ___ amigos como mi hermana.","answer":"tantos"},{"id":"u24_1_5","sentence":"5. En Canarias no hace (=) ___ calor como en Cuba.","answer":"tanto"},{"id":"u24_1_6","sentence":"6. Jos\xe9 Manuel trabaja (\u2013) ___ horas que t\xfa.","answer":"menos"},{"id":"u24_1_7","sentence":"7. Tenemos (=) ___ prisa como t\xfa.","answer":"tanta"},{"id":"u24_1_8","sentence":"8. Samuel tiene (+) ___ ropa que yo.","answer":"m\xe1s"},{"id":"u24_1_9","sentence":"9. En La Paz hace (+) ___ fr\xedo que en Caracas.","answer":"m\xe1s"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 24.2: \u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0435 \u0441\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u044f, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f \u0441\u043b\u043e\u0432\u0430 \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430","content":[{"text":"<strong>\u0421\u043b\u043e\u0432\u0430 \u0434\u043b\u044f \u0441\u043f\u0440\u0430\u0432\u043e\u043a:</strong> a\xf1os, calor, corbatas, dinero, estudiantes, fr\xedo, habitantes, hambre, leche, postales"}],"tasks":[{"id":"u24_2_1","sentence":"1. Roberto tiene 200 pesos. Clara tiene 20. Clara tiene ___ Roberto.","answer":"menos dinero que"},{"id":"u24_2_2","sentence":"2. Elsa bebe 1/2 litro de leche al d\xeda. Eloy bebe 1 litro. Elsa no bebe ___ Eloy.","answer":"tanta leche como"},{"id":"u24_2_3","sentence":"3. Hoy hace 30\xb0. Ayer hizo 25\xb0. Hoy hace ___.","answer":"m\xe1s calor que ayer"},{"id":"u24_2_4","sentence":"4. Rosario tiene un mill\xf3n de habitantes; Mendoza tiene un mill\xf3n y medio de habitantes. Rosario no tiene ___.","answer":"tantos habitantes como Mendoza"},{"id":"u24_2_5","sentence":"5. Sim\xf3n tiene 30 a\xf1os; yo tengo 28. Sim\xf3n tiene ___.","answer":"m\xe1s a\xf1os que yo"},{"id":"u24_2_6","sentence":"6. Ayer vinieron doce estudiantes; hoy han venido diez. Hoy no han venido ___.","answer":"tantos estudiantes como ayer"},{"id":"u24_2_7","sentence":"7. Ayer hizo 5\xb0. Hoy hace 10\xb0. Hoy no hace ___.","answer":"tanto fr\xedo como ayer"},{"id":"u24_2_8","sentence":"8. No he comido nada desde esta ma\xf1ana; Irene no ha comido nada desde anoche. Irene tiene ___.","answer":"tanta hambre como yo"},{"id":"u24_2_9","sentence":"9. Tengo dos corbatas; t\xfa tambi\xe9n tienes dos corbatas. Tengo ___.","answer":"tantas corbatas como t\xfa"},{"id":"u24_2_10","sentence":"10. Hab\xe9is recibido cinco postales este verano; yo he recibido tres. He recibido ___.","answer":"menos postales que vosotros"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 24.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u043e\u0442\u0432\u0435\u0442\u044b \u043a\u0430\u043a \u0432 \u043f\u0440\u0438\u043c\u0435\u0440\u0435","tasks":[{"id":"u24_3_1","sentence":"1. \u2013Felipe tiene dos hijos. \u2013Yo tengo <u>m\xe1s</u>. Tengo cuatro.","answer":"m\xe1s"},{"id":"u24_3_2","sentence":"2. \u2013Tengo siete hermanos. \u2013Yo tengo casi ___ t\xfa. Tengo seis.","answer":"tantos como"},{"id":"u24_3_3","sentence":"3. \u2013Aurora tiene 30 d\xedas de vacaciones. \u2013Yo no tengo ___. Tengo 22.","answer":"tantos"},{"id":"u24_3_4","sentence":"4. \u2013Tengo unos quinientos libros. \u2013Yo no tengo ___. Tengo unos trescientos.","answer":"tantos"},{"id":"u24_3_5","sentence":"5. \u2013Tengo sue\xf1o. He dormido solo cuatro horas. \u2013Yo tengo ___. He dormido solo dos horas.","answer":"menos"},{"id":"u24_3_6","sentence":"6. \u2013Hoy hay cerca de doscientos espectadores. \u2013Ayer hab\xeda ___. Hab\xeda solo cincuenta.","answer":"menos"},{"id":"u24_3_7","sentence":"7. \u2013Hemos estado en diez pa\xedses diferentes. \u2013Yo he estado en ___. He estado en doce.","answer":"menos"},{"id":"u24_3_8","sentence":"8. \u2013Trabajo ocho horas al d\xeda. \u2013Yo trabajo ___. Tambi\xe9n trabajo ocho.","answer":"tantas como t\xfa"}]}]}')}}]);